import React, {FC} from 'react';
import { card } from "./CardStyles";

interface Props {
    title?: string;
    children?: any;
}

export const Card: FC<Props> = ({ title, children }) => {
    return (
        <card.Item>
            <card.ItemWrapper>
                <card.Title>
                    <a title={ title} >{ title }</a>
                </card.Title>
                { children }
            </card.ItemWrapper>
        </card.Item>
    );
}
